  studentDetails: IStudentDetail[];
  classTitleId: string[];
  classAssignments: IClassAssignment[];
  studentGrades: IStudentGrade[];
}

const columns: GridColDef[] = [
  {
    field: "studentID",
    headerName: "Student ID",
  },
  {
    field: "studentName",
    headerName: "Student Name",
    width: 150,
  },
  {
    field: "classID",
    headerName: "Class ID",
  },
  {
    field: "className",
    headerName: "Class Name",
  },
  {
    field: "semester",
    headerName: "Semester",
  },
  {
    field: "finalGrade",
    headerName: "Final Grade",
  },
];




export const Test = ({ studentGrades, studentDetails, classTitleId, classAssignments }: TestProps) => {

  const assignmentNumbers = classAssignments.length;
  console.log(classAssignments);
  const classTitle = classTitleId[0];
  const classId = classTitleId[1];
  const rows = studentDetails.map((student, index) => {

    if (Array.isArray(student)) {
      const s = student[0];
      const studentId = s.universityId;

      const currStudentGrade = studentGrades.filter((s) => s.studentId === studentId);
      if (Array.isArray(currStudentGrade)) {
        const s = currStudentGrade[0];
        const grade = s.grades;
        console.log(grade);}




      return {
        id: uuidv4(),
        studentID: studentId,
        studentName: s.name,
        classID: classId,
        className: classTitle,
        semester: "fall2022",
        finalGrade:"",
      };
    } else {
      return {
        id: index,
        studentID: "loading...",
        studentName: "loading...",
        classID: classId,
        className: classTitle,
        semester: "fall2022",
        finalGrade: "Unknown",
      };
    }


  });
  return (
    <Box sx={{ height: 400, width: "100%" }}>
      <DataGrid rows={rows} columns={columns} pageSize={10} />
    </Box>
  );
};
